import "./login.css"
import CheckBoxOutlineBlankIcon from '@mui/icons-material/CheckBoxOutlineBlank';

export default function Login() {
    return (
        <>
            <div className="loginContainer">
                <a href="#" id="text">Instagram</a>
                <input className="loginInput" type="text" placeholder="Phone number, username or email adress"/>
                <input className= "loginInput" id="loginInput1" type="text" placeholder="Password" />
                <span className="loginTxt"><CheckBoxOutlineBlankIcon className="loginIcon"/>  Save Login Info</span>
                <button className="loginBtn">Log in</button>
                <a href="#" className="loginForgot">Forgotten Your Password?</a>
            </div>
        </>
    )
}
